Things that can be matched over are called patterns , and there's a fairly large number of them. In this section we'll try to document the most common ones. Patterns that can be matched over are the following: A unit, simply (). A boolean value, like true or false. A byte, like b'a' or b'\x10'. A character, like 'a' or 'あ'. An integer, like 42. A string, like "Steven Universe". A vector, like the numbers [1, _, ..], or simply the empty vector []. The values in the vectors are patterns themselves. A tuple, like ("Steven Universe", _, 42). The values in the tuple are patterns themselves. An object, like the numbers {"name": "Steven Universe", "age": _}, or the empty {}. The values in the object are patterns themselves. Structs can be matched over by prefixing the match with their name: A unit struct: Foo. A tuple struct: Foo(1, _). An object struct: Foo { bar: 1, .. }. Similarly, variants in an enum can be matched over as well in the same way: A unit variant: Foo::Variant. A tuple variant: Foo::Variant(1, _). An object variant: Foo::Variant { bar: 1, .. }. Patterns can be almost any combination of the above. Even {"items": ["Sword", "Bow", "Axe"]} is a pattern that can be matched over. Anything that qualifies as a collection can have .. as a suffix to match the case that there are extra fields or values which are not covered in the pattern. This is called a rest pattern . pub fn main() { let value = #{ a: 0, b: 1 }; let matched = match value { // this doesn't match, because a pattern without a rest pattern in it // must match exactly. #{ a } => false, // this matches, because it only requires `a` to be present. #{ a, .. } => true, }; assert!(matched, "rest pattern matched");
} $> cargo run --bin rune -- run scripts/book/pattern_matching/rest_pattern.rn
