) -> rune::Result<TokenStream> { let mut parser = Parser::from_token_stream(stream, ctx.stream_span()); let mut output = quote!(0); while !parser.is_eof()? { let op = parser.parse::<ast::Ident>()?; let arg = parser.parse::<ast::Expr>()?; output = match ctx.resolve(op)?.as_ref() { "add" => quote!((#output) + #arg), "sub" => quote!((#output) - #arg), "div" => quote!((#output) / #arg), "mul" => quote!((#output) * #arg), _ => return Err(SpannedError::msg(op.span(), "unsupported operation").into()), } } parser.eof()?; Ok(output.into_token_stream(ctx))
