GitHub issue: https://github.com/rune-rs/rune/issues/15 A type hash is a 64-bit hash which uniquely identifies a type in Rune. The type hash for an external Any type is currently defined like this: pub fn from_type_id(type_id: std::any::TypeId) -> Hash { unsafe { std::mem::transmute(type_id) }
} The transmute is sound (ish), both are currently defined as 64-bit unsigned integers. They both just have to be integers, signed or not of the same type. The issue is that the type check to determine if an Any type is a specific type is defined like this: pub fn is<T>(&self) -> bool
where T: std::any::Any,
{ Hash::from_type_id(std::any::TypeId::of::<T>()) == self.type_hash()
} We could use TypeId directly here, but TypeId's cannot be constructed for types unknown to Rust, which prevent it from being used through a C ffi. A raw AnyObjVtable has to be usable outside of Rust. An interesting detail is that this is actually a soundness hole in Rust right now. In the future we might also implement a lookaside table stored in the Unit for types registered in Any, which requires all types used to be registered beforehand in order to detect these hash conflicts. Any dynamic types already use such a table at the time we install modules into the Context . So the current conclusion is: Externally defined types (C ffi) must use properly random type hashes. The risk for the current safety issue is deemed to be low.

